description:
The platform will include the following modules:
Release of TerraEcocoin's own crypto currency with POI generation (Proof-of-Importance, proof of importance);
Decentralized Investment Ecological Fund (IEF);
Fundraising application - service for creation of a personal digital token by initiators of ecological projects through one-time, or accelerated emission for financing ecological (green) projects approved by Ecostart experts;
Cryptomessenger, built on P2P technology (peer-to-peer);
Service for examination, recommendations and formation of ratings of trust and reputation;
Space Surface Earth Surface Application
Crypto Lottery;
The system of motivation (incentives) of volunteers, initiators of EP and investors;
Open API for creating applications for the implementation and support of EP.
